import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import SideBar from "./componets/SideBar";
import Home from "./pages/Home";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <SideBar />
        <Route path="/home" element={<Home />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
